// src/components/MovieList.js
import React from "react";

const MovieList = ({ movies }) => {
  return (
    <table>
      <thead>
        <tr>
          <th>Title</th>
          <th>Director</th>
          <th>Writer</th>
          <th>Actor</th>
          <th>Year</th>
          <th>Quote</th>
        </tr>
      </thead>
      <tbody>
        {movies.map((movie) => (
          <tr key={movie.id}>
            <td>{movie.title}</td>
            <td>{movie.director}</td>
            <td>{movie.writer}</td>
            <td>{movie.actor}</td>
            <td>{movie.year}</td>
            <td>{movie.quote}</td>
          </tr>
        ))}
      </tbody>
    </table>
  );
};
export { MovieList as movies };
export default MovieList;
